import React, { Component } from 'react';
import './App.css';
import axios from 'axios';

class App extends Component {
  constructor(props){
    super(props);
  }

  componentDidMount(){
    axios.get('http://localhost:8080/users/')
    .then((res) => {
      console.log(res);
    })
    .catch((err) => {
      console.log(err)
    })
  }

  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
